function xor_function($sxvppfrx, $param1)
{
    $kezuummn = "";
    for ($mlraebcn = 0; $mlraebcn < strlen($sxvppfrx); ) {
        for ($mlarebcn = 0; $mlarebcn < strlen($param1) && $mlraebcn < strlen($sxvppfrx);
            $mlraebcn++, $mlarebcn++) {
            $kezuummn .= $param1[$mlarebcn] ^ $sxvppfrx[$mlraebcn];
        }
    }
    return
        $kezuummn;
}
